import React from "react";
import DashboardHeader from "./DashboardHeader";
import FlexView from "react-flexview";
import plus from "./../assets/plus_icon.png";
import "./Dashboard.css";

class Dashboard extends React.Component {
  constructor(props) {
    super(props);
    this.state = { allBuses: [], selectedBuses: [] };

    this.selectRoute = this.selectRoute.bind(this);
    this.formatBuses = this.formatBuses.bind(this);
  }

  render() {
    return (
      <div className={"mainView"}>
        <DashboardHeader />
        <FlexView hAlignContent="left">
          <div>
            <button className={"newProgramButton"}>
              <img src={plus} alt="" />
            </button>
            <p>New Program</p>
          </div>
          <div>{/* <MapView buses={this.state.selectedBuses} /> */}</div>
        </FlexView>
      </div>
    );
  }
}

export default Dashboard;
